import React, { useEffect, useState } from 'react'
import ToTop from '../../asset/svgs/component_scroll.svg'

import Bg from '../../asset/svgs/anh.svg'

const MyPage = () => {
  const [data, setData] = useState()
  const [fillter, setFillter] = useState({ page: 1, limit: 10, string: 'all' })

  const fetchData = () => {
    if (fillter.page === 1) {
      setData(
        Array(fillter.limit).fill({
          date: `0${fillter?.string}.21.Morning`,
          image:
            'data:image/png;base64,',
        }),
      )
    } else {
      setData((prev) => [
        ...prev,
        ...Array(fillter.limit).fill({
          date: `0${fillter.string}.21.Morning`,
          image:
            'data:image/png;base64,',
        }),
      ])
    }
  }

  useEffect(() => {
    fetchData()
  }, [fillter])

  const filter = (value) => {
    setFillter((prev) => ({ ...prev, string: value, page: 1 }))
  }

  const loadMore = () => {
    setFillter((prev) => ({ ...prev, page: prev + 1 }))
  }

  return (
    <div className="m-auto max-w-[960px] pb-[64px] relative">
      <div className="flex gap-[74px] justify-center my-[24px]">
        {' '}
        <div
          className="w-[100px] h-[100px] cursor-pointer relative"
          onClick={() => filter(1)}
        >
          <img src={Bg} alt="" className="w-[100%] h-[100%]" />
        </div>{' '}
        <div
          className="w-[100px] h-[100px] cursor-pointer relative"
          onClick={() => filter(2)}
        >
          <img src={Bg} alt="" className="w-[100%] h-[100%]" />
        </div>{' '}
        <div
          className="w-[100px] h-[100px] cursor-pointer relative"
          onClick={() => filter(3)}
        >
          <img src={Bg} alt="" className="w-[100%] h-[100%]" />
        </div>{' '}
        <div
          className="w-[100px] h-[100px] cursor-pointer relative"
          onClick={() => filter(4)}
        >
          <img src={Bg} alt="" className="w-[100%] h-[100%]" />
        </div>
      </div>
      <div className="flex my-[10px] mb-[28px]">
        <div class="grid grid-cols-4 gap-[8px] w-[100%]">
          {data?.map((value, index) => (
            <div key={index} className="h-[241.53px] relative">
              <img src={value.image} alt="" className="w-[100%] h-[100%]" />
              <span className="absolute left-0 bottom-0 p-[8px] bg-yellow300">
                {value?.date}
              </span>
            </div>
          ))}
        </div>
      </div>
      <div
        className="h-[56px] w-[296px] m-auto flex items-center justify-center bg-yellow300 cursor-pointer"
        onClick={loadMore}
      >
        記録をもっと見る
      </div>
      <img
        src={ToTop}
        alt=""
        className="fixed right-[calc(25vw/2)] top-[50%] cursor-pointer"
        onClick={() => {
          window.scrollTo({ top: 0, left: 0, behavior: 'smooth' })
        }}
      />
    </div>
  )
}

export default MyPage
